COPY djangocms_text_ckeditor_text (cmsplugin_ptr_id, body) FROM stdin;
7	<h2><strong>Plan your trip</strong></h2>\n\n<p>Define when you what to take your next vacation and provide us what do you want to do, Trixdiscover provide you with activities, past experiences and locations that fit your dreams.</p>\n\n<h2><strong>Organize your time</strong></h2>\n\n<p>Explore activities that you want to carried in your trip, then explore the time and distance to be able to jump from place to place to have a great time.</p>\n\n<h2><strong>Set your plan</strong></h2>\n\n<p>Once you discover the places and make your mind of your plan, connect with the Chipocludo in Town to make appointments and plan your activities.</p>\n
213	<p>This is version 0.0001 of TrixDiscover:</p>\n\n<ul>\n\t<li>Homepage</li>\n\t<li>What do you want to do?</li>\n\t<li>List the activities available about your interest</li>\n\t<li>Show you where you TrixDiscover found activities of your interest</li>\n</ul>\n
1	<h1><big>Welcome to TrixDiscover!</big></h1>\n\n<p><big>Are you eager to discover a hidden spot to spend your next vacation in Mexico?</big></p>\n\n<p><big><strong>TrixDiscover</strong> want to help you plan your next vacation or weekend by connecting with local people that know fantastic places that they keep secretly to share with their friends.</big></p>\n\n<p><big>When you visit the place, <strong>TrixDiscover</strong> will help you to find what is going on every day in your stay.</big></p>\n\n<p><big>Then, when your return from these magic days, invite to share your experiences and set your mind to find the next time slot in your busy life to enjoy new times.</big></p>\n\n<p> </p>\n\n<table cellspacing="10" style="width: 100%;" border="0" cellpadding="10">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td width="50%" style="text-align: center;">\n\t\t\t<p><big>Are your ready to explore the world?</big></p>\n\t\t\t</td>\n\t\t\t<td width="50%">\n\t\t\t<p><big><img src="/media/filer_public_thumbnails/filer_public/7c/4c/7c4c6383-bd10-477e-957a-99f84743878a/sayulita-mexico-1.jpg__400x256_q85_crop_subsampling-2_upscale.jpg" title="Image - Sayulita-Mexico-1.jpg" alt="Image" id="plugin_obj_2"></big></p>\n\t\t\t</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n<div style="background: #eee; border: 1px solid #ccc; padding: 5px 10px;"> </div>\n
219	<h1>What to do?</h1>\n\n<p><img src="/media/filer_public_thumbnails/filer_public/46/1a/461a316f-d6a1-4014-9bab-4470e6a7655f/what_to_do.png__1199x372_q85_crop_subsampling-2_upscale.png" title="Image - what to do.png" alt="Image - what to do.png" id="plugin_obj_220"></p>\n\n<p>Description</p>\n\n<p>Elements</p>\n\n<p> </p>\n
221	<h2>Activities in: ??????</h2>\n\n<p><img src="/media/filer_public_thumbnails/filer_public/9f/c6/9fc6fa6e-3b5a-4eb1-9d1b-63ce41519729/activities.png__1204x242_q85_crop_subsampling-2_upscale.png" title="Image - activities.png" alt="Image - activities.png" id="plugin_obj_222"></p>\n\n<p> </p>\n
223	<h2>Activities to do in: ???????</h2>\n\n<p> </p>\n\n<p><img src="/media/filer_public_thumbnails/filer_public/92/cb/92cb1fcf-e29c-4e01-a03b-9e617a4642b8/map.png__1211x346_q85_crop_subsampling-2_upscale.png" title="Image - map.png" alt="Image - map.png" id="plugin_obj_224"></p>\n\n<p> </p>\n
186	<h1>This is version 0.0001 of TrixDiscover:</h1>\n\n<ul>\n\t<li>Homepage</li>\n\t<li>What do you want to do?</li>\n\t<li>List the activities available about your interest</li>\n\t<li>Show you where you TrixDiscover found activities of your interest</li>\n</ul>\n
9	<h2><strong>Remember your trip</strong></h2>\n\n<p>You have a lot of thing to tell to your friends when you come back home. Organize your memories and record the best moments to keep your adventure alive.</p>\n\n<h2><strong>Share your experience</strong></h2>\n\n<p>With your great times you want to connect with more people to share what happen and help new people to discover new places and to have that unique moments that you enjoy in your trip.</p>\n\n<h2><strong>Keep your mind open</strong></h2>\n\n<p>Your great trip will the unique opportunity to plan the next one. To expand your knowledge and discover a lot of new friends that enjoy the life in the same way than you.</p>\n
225	<h1>Capture data from Twitter</h1>\n\n<p><strong>Descripcion</strong>: capturar informacion disponible en twitter utilizando dos elementos: palabras clave (busqueda y hastagas) y cuentas de referencia -- esto produce un stream de twitters donde hay que identificar actividaes por medio de una tabla de palabras o frases</p>\n\n<p> </p>\n\n<p><strong>Resultado</strong>: resumen periodico (cada 24 horas ) de las actividades mas importantes que han sucedido en una localidad, quienes las hicierno y cual es la referencia de ella</p>\n\n<p>Como hacerlo: montar un servicio que obtenga la informacion de las ultimas 24 horas, almacenarlo en una base de datos (con el modelo de datos -- Por definir)</p>\n\n<p>Despues de extraer los datos, presentarlos para su evaluacion, limpieza y tomar los datos validos.</p>\n\n<ol>\n\t<li>validos: pasarlos a una base de información permanente </li>\n\t<li>los que no pasaron los criterios almacenarlos para uso futuro</li>\n</ol>\n\n<p> </p>\n
