3	1	1	json	[{"fields": {"body": "<h1>Welcome to TrixDiscover!</h1>\\n\\n<p>Are you eager to discover a hidden spot to spend your next vacation in Mexico?</p>\\n\\n<p><strong>TrixDiscover</strong> want to help you plan your next vacation or weekend by connecting with local people that know fantastic places that they keep secretly to share with their friends.</p>\\n\\n<p>When you visit the place, <strong>TrixDiscover</strong> will help you to find what is going on every day in your stay.</p>\\n\\n<p>Then, when your return from these magic days, invite to share your experiences and set your mind to find the next time slot in your busy life to enjoy new times.</p>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 1}]	Welcome to TrixDiscover!...	22	1
