236	1	1	json	[{"fields": {"body": "<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">Welcome to TrixDiscover!</div>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">Are you eager to discover a hidden spot to spend your next vacation in Mexico?</div>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\"><strong>TrixDiscover</strong> want to help you plan your next vacation or weekend by connecting with local people that know fantastic places that they keep secretly to share with their friends.</div>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">When you visit the place, <strong>TrixDiscover</strong> will help you to find what is going on every day in your stay.</div>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">Then, when your return from these magic days, invite to share your experiences and set your mind to find the next time slot in your busy life to enjoy new times.</div>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">\\u00a0</div>\\n\\n<table cellspacing=\\"10\\" style=\\"width: 100%;\\" border=\\"0\\" cellpadding=\\"10\\">\\n\\t<tbody>\\n\\t\\t<tr>\\n\\t\\t\\t<td width=\\"50%\\" style=\\"text-align: center;\\">\\n\\t\\t\\t<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">Are your ready to explore the world?</div>\\n\\t\\t\\t</td>\\n\\t\\t\\t<td width=\\"50%\\">\\n\\t\\t\\t<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\"><img src=\\"/media/filer_public_thumbnails/filer_public/7c/4c/7c4c6383-bd10-477e-957a-99f84743878a/sayulita-mexico-1.jpg__400x256_q85_crop_subsampling-2_upscale.jpg\\" title=\\"Image - Sayulita-Mexico-1.jpg\\" alt=\\"Image\\" id=\\"plugin_obj_2\\"></div>\\n\\t\\t\\t</td>\\n\\t\\t</tr>\\n\\t</tbody>\\n</table>\\n\\n<div style=\\"background: #eee; border: 1px solid #ccc; padding: 5px 10px;\\">\\u00a0</div>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 1}]	Welcome to TrixDiscover!...	22	19
237	8	8	json	[{"fields": {"body": "<h2><strong>Start your trip</strong></h2>\\n\\n<p>Have in one place all the information to make your dream trip happen as desired. Your travel references and contacts in one place.</p>\\n\\n<h2><strong>Follow the plan</strong></h2>\\n\\n<p>Keep track of all the action, follow the connections and discover each one of your places that you have been discovering.</p>\\n\\n<h2><strong>Discover what is happening</strong></h2>\\n\\n<p>You plan a lot of activities, and then you find that always are some things to be done that you didn\\u00b4t knew from the beggining, TrixDiscover keeps and eye in what is going on in the places that you are visitng. Then you have additional recommendatios of new locations and activities to add on the fly.</p>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 8}]	Start your trip...	22	19
238	9	9	json	[{"fields": {"body": "<h2><strong>Remember your trip</strong></h2>\\n\\n<p>You have a lot of thing to tell to your friends when you come back home. Organize your memories and record the best moments to keep your adventure alive.</p>\\n\\n<h2><strong>Share your experience</strong></h2>\\n\\n<p>With your great times you want to connect with more people to share what happen and help new people to discover new places and to have that unique moments that you enjoy in your trip.</p>\\n\\n<h2><strong>Keep your mind open</strong></h2>\\n\\n<p>Your great trip will the unique opportunity to plan the next one. To expand your knowledge and discover a lot of new friends that enjoy the life in the same way than you.</p>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 9}]	Remember your trip...	22	19
