754	48	48	json	[{"fields": {"body": "<h1>Discovering hidden activities in Sayulita</h1>\\n\\n<p>Millions of people travel every year as part of their regular activities, some time for business some times for pleasure, but in all the cases we never have time to take the best advantage of each trip because we are very busy before our trip, during the trip and hardly we build a memory of what we did during this travel.</p>\\n\\n<p>TrixDiscover work for you as your assistant to plan your trip, help during the trip and then create the memories to share with friends and family as well to give us back the opportunity to live again what we did in our trips.</p>\\n\\n<p>The big question that we try to solve for you is:</p>\\n\\n<p>\\u00a0</p>\\n\\n<h2 style=\\"font-style: italic; text-align: center;\\"><strong>How do you find what is available in the next place </strong></h2>\\n\\n<h2 style=\\"font-style: italic; text-align: center;\\"><strong>that you will visit for business or vacations?</strong></h2>\\n\\n<p>\\u00a0</p>\\n\\n<p>The way than TrixDiscovery works is that you set your schedule for your future trips, define the kind of trip you will be doing, the timeframe for it and the constrains and interest that you would like to fulfill.</p>\\n\\n<p>For instances, for pleasure some times we want to do some activities in particular much more than go to a specific place. Here you provide your areas of interest and the kind of activities that are akin for you.</p>\\n\\n<p>Then TrixDiscovery works like your coach and assistant providing you with recommendations and learning from your taste along you provide feedback during the shaping of your trip.</p>\\n\\n<p>You will find that there are much more to do than your available time and budget, and then you can refine your trip adjusting your available time and keeping the trip under your proposed budget.</p>\\n\\n<p>Let\\u00b4s explore together how we can create the best trips possible. Your learning will help to learn more how to travel and enjoy the life.</p>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 48}]	Discovering hidden activities...	22	56
