892	36	36	json	[{"fields": {"body": "<h2>Sayulita, playa de ensue\\u00f1o</h2>\\n\\n<p>Known for its consistent river mouth surf break, Sayulita was \\"discovered\\" by roving surfers in the late 1960s with the construction of Mexican Highway 200. Today, Sayulita is a prosperous growing village of approximately 6,000 residents. Hailed as a popular off-the-beaten-path travel destination, Sayulita offers a variety of activities such as\\u00a0<a title=\\"Horseback riding\\" href=\\"https://en.wikipedia.org/wiki/Horseback_riding\\">horseback riding</a>,\\u00a0<a title=\\"Hiking\\" href=\\"https://en.wikipedia.org/wiki/Hiking\\">hiking</a>, jungle canopy tours,\\u00a0<a title=\\"Snorkeling\\" href=\\"https://en.wikipedia.org/wiki/Snorkeling\\">snorkeling</a>\\u00a0and\\u00a0<a title=\\"Fishing\\" href=\\"https://en.wikipedia.org/wiki/Fishing\\">fishing</a>. Still a mecca for beginner surfers of all ages, the quaint town attracts upscale tourists with its numerous art galleries and restaurants as well.<sup id=\\"cite_ref-Sayulita_Nayarit_1-0\\"><a href=\\"https://en.wikipedia.org/wiki/Sayulita#cite_note-Sayulita_Nayarit-1\\">[1]</a></sup>\\u00a0Sayulita has a curious eclectic quality, frequented by native Cora and Huichol peoples, traveling craftsmen as well as international tourists.<sup id=\\"cite_ref-SayulitaBeach_2-0\\"><a href=\\"https://en.wikipedia.org/wiki/Sayulita#cite_note-SayulitaBeach-2\\">[2]</a></sup>\\u00a0Sayulita is the crown jewel in the newly designated \\"Riviera Nayarit\\", the coastal corridor from Litibu to San Blas. Its natural beauty and easy access to Puerto Vallarta have made Sayulita real estate some of the most sought after in all of Mexico. With a growing ecological awareness and stricter zoning enforcement, development is being regulated to help safeguard the environment and quality of life of the community. Sayulita now has a medical office with an English-speaking doctor and pharmacist, a number of internet cafes and a wide variety of open-air eateries\\u2014some right on the sand beach.</p>\\n\\n<p>Sayulita has recently become a wedding destination with a\\u00a0<a title=\\"Roman Catholic\\" href=\\"https://en.wikipedia.org/wiki/Roman_Catholic\\">Roman Catholic</a>\\u00a0church and a number of local wedding planners</p>\\n\\n<p><img src=\\"/static/cms/img/icons/plugins/link.png\\" title=\\"Link - Learn more of Sayulita in Wikipedia\\" alt=\\"Link\\" id=\\"plugin_obj_39\\"></p>\\n"}, "model": "djangocms_text_ckeditor.text", "pk": 36}]	Sayulita, playa de...	22	69
